import React from 'react';
import Mensagem from './mensagem';
import './mensagens.css'
const Msgs = [
    {
        id: 0,
        userID: 0,
        userName: 'User1',
        mensagem: 'Olá mundo, sou a primeira mensagem',
        timestamp: new Date()
    },
    {
        id: 1,
        userID: 1,
        userName: 'User2',
        mensagem: 'Olá mundo, sou a segunda mensagem',
        timestamp: new Date()
    }, {
        id: 2,
        userID: 1,
        userName: 'User2',
        mensagem: 'Olá mundo, sou a segunda mensagem',
        timestamp: new Date()
    }, {
        id: 3,
        userID: 1,
        userName: 'User2',
        mensagem: 'Olá mundo, sou a segunda mensagem',
        timestamp: new Date()
    }, {
        id: 4,
        userID: 1,
        userName: 'User2',
        mensagem: 'Olá mundo, sou a segunda mensagem',
        timestamp: new Date()
    }

]
function Mensagens() {
    return (
        <div className='mensagens-container'>
            <div className = 'mensagens-box'>
                {Msgs.map((item, key) => (
                    <div>
                        <Mensagem key = {key} msg={item} />
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Mensagens;
